import './styles.css';
export default function Balao({ text, text2, rounded, className }) {
  return (
    <div
      className={`${rounded} ${className} conte3  text-white flex flex-col h-[70%]  list-disc items-center justify-center px-8`}
    >
      <div className="rounded-3xl">
        <div className="text-2xl">{text}</div>
        <br></br>
        <div className="text-2xl">{text2}</div>
      </div>
    </div>
  );
}
